        setup_max_max = max(y[4] for y in ys)
        setup_mean_max = max(y[5] for y in ys)
        for j, (cr, mr, _, __, fitness_max, fitness_mean,) in enumerate(ys):
            table_str[2+j] += r'%.2f & %.2f & %s & %s' % (
                   cr, mr,
                   color_if_eq(setup_max_max, fitness_max, 'green'),
                   color_if_eq(setup_mean_max, fitness_mean, 'yellow'), )
        for j in range(len(ys)+2):
            if i == len(xs)-1:
                table_str[j] += r' \\ \hline'
